animal.description:
Boots is a gorgeous boy who loves to run and play. Boy does he love his toys. He loves everyone he meets and seems to like most dogs, he can't play much now as he is still recovering from his neuter. Boots does know sit, walks well on leash & appears to be housebroken. He is quiet in his kennel & patiently waits his turn. Boots would do best in a home with a fenced in yard as he loves to run around & play. He is fully vetted, microchipped & neutered
Boots is a Pay It Forward dog. This means the adoption donation of $500 will help to save another pup needing rescue and vetting. If you are interested in this dog, please complete an adoption application.
Email: dogs@almosthomefoundation.org

Almost Home Foundation's adoption requirements:
(1) Be at least 21 years of age;
(2) Have the consent of all adults living in the household;
(3) Have approval from the residence owner;
(4) Have valid ID with current address;
(5) Be approved by Almost Home Foundation as a suitable adoptive home; and
(6) Live in the suburbs surrounding Schaumburg (Illinois Residents only)
*** Please note that Almost Home Foundation accepts only cash or checks for adoption fees; we do not accept debit or credit cards. ***
